import React from 'react';
import Card from './Card.js';

class CardList extends React.Component {
    render() {
        console.log("cardlist", this.props);

        return (
            <div className="row">
            {this.props.map(site => <Card{...site}/>)}
                <Card />
            </div>
        )
    }
}

export default CardList;
